import { useState } from "react";


import Nav from "./componente/Nav";
import MovieContainer from "./componente/MovieContainer";
import AddMovie from "./componente/AddMovie";

import "./App.css";

function App() {
  const [movies, setMovies] = useState([
    {
      id: "2525252",
      img: "data:image/jpeg;base64,",
      name: "Jhon Wick",
      rating: 4,
    },
    {
      id: "85",
      img: "data:image/jpeg;base64,",
      name: "el camino",
      rating: 2,
    },
    {
      id: "63",
      img: "data:image/jpeg;base64,",
      name: "end game",
      rating: 5,
    },
    {
      id: "41",
      img: "https://fr.web.img2.acsta.net/medias/nmedia/18/63/97/89/18949761.jpg",
      name: "Batman",
      rating: 5,
    },
    {
      id: "55",
      img: "https://m.media-amazon.com/images/M/MV5BMTkxNTk1ODcxNl5BMl5BanBnXkFtZTcwMDI1OTMzOQ@@._V1_.jpg",
      name: "The great gatsby",
      rating: 4,
    },
    {
      id: "9693",
      img: "https://m.media-amazon.com/images/I/514F6YkVOaL._AC_.jpg",
      name: "whispflash",
      rating: 3,
    },
    {
      id: "456",
      img: "https://m.media-amazon.com/images/M/MV5BMjEzNzM2MjgxMF5BMl5BanBnXkFtZTcwNTQ1MTM0Mg@@._V1_FMjpg_UX1000_.jpg",
      name: "angels and demon",
      rating: 4,
    },
  ]);

  const [input, setInput] = useState("");

  const [rating, setRating] = useState(0);

  const [isOpen, setIsOpen] = useState(false);

  const [newMovie, setNewMovie] = useState({
    id: Math.random(),
    img: "",
    name: "",
    rating: 1,
  });

  const handleInput = (e) => {
    setInput(e.target.value);
  };

  const handleRating = (newRating) => {
    setRating(newRating);
  };

  const handleIsOpen = () => {
    setIsOpen(!isOpen);
  };

  const handleNewMovie = (e) => {
    if (e.target.name === "rating") {
      setNewMovie({ ...newMovie, [e.target.name]: +e.target.value });
    } else {
      setNewMovie({ ...newMovie, [e.target.name]: e.target.value });
    }
  };

  const handleAddMovie = () => {
    if (newMovie.rating >= 1 && newMovie.rating <= 5) {
      setMovies([...movies, newMovie]);
      handleIsOpen();
    } else {
      alert("Movie rating should be between 1 and 5.");
    }
  };

  console.log(movies);

  return (
    <div className="App">
      <Nav
        rating={rating}
        handleRating={handleRating}
        input={input}
        handleInput={handleInput}
        handleIsOpen={handleIsOpen}
      />
      <br />
      <br />
      <AddMovie
        isOpen={isOpen}
        handleIsOpen={handleIsOpen}
        newMovie={newMovie}
        handleNewMovie={handleNewMovie}
        handleAddMovie={handleAddMovie}
      />
      <MovieContainer movies={movies} rating={rating} input={input} />
    </div>
  );
}

export default App;